window.bookSummaryJSON = "<p>The second and final book in the Master of Trickery Duet!</p> <p>\"Must be brave, stubborn, and impervious to the tempers of loved ones\".</p> <p>The first line hissed with history.</p> <p>\"Hours are endless, pay is non-existence, quitting absolutely forbidden\".</p> <p>The second line ached with truth.</p> <p>\"Able to function on no sleep, refrain from running when times get hard, and be more than just a living canvas but a lover\".</p> <p>The third thrummed with honesty.</p> <p>\"Other attributes required: forgiving, opinionated, and not afraid to tell me when I'm wrong. Must also enjoy being touched and kissed at any time of my choosing\".</p> <p>The fourth glowed with promise.</p> <p>\"Call or email \"your heart, his soul\" if interested in applying.\"</p> <p>The final made my future unfold.</p> <p>The advert was so similar to one I should never have applied for.</p> <p>A twist of fate that brought two destined people back together.</p> <p>A job I would take in a heartbeat if the employer could offer such terms.</p> <p>But I wasn't free.</p> <p>Neither was Gil.</p> <p>Therefore, my interview could never happen.</p>"; 
